import Dropdown from "../../ui/Dropdown";
import InputBox from "../../ui/InputBox";
import { FilterRowContainer, Combiner, StyledText } from "../FiltersBar/FiltersBar.styles";

type Props = {
  index: number;
  values: FilterValues;
  removeFilter(): void;
};

const FilterRow = ({ values, index }: Props) => {
  return (
    <FilterRowContainer>
      <StyledText>{index + 1}.</StyledText>
      <Combiner>
        {
            index > 0 &&
                <StyledText background={'primaryBlue'}>And</StyledText>
        }
      </Combiner>
      <Dropdown
        value={values.key}
        options={[]}
        variant={"rectangle"}
        readOnly
      />
      <Dropdown
        value={values.operator}
        options={[]}
        variant={"rounded"}
        readOnly
      />
      <InputBox value={values.value} inputType={"text"} readOnly />
    </FilterRowContainer>
  );
};

export default FilterRow;
